def correct_bracketing(brackets: str):
    """ brackets is a string of "<" and ">".
    return True if every opening bracket has a corresponding closing bracket.

    >>> correct_bracketing("<")
    False
    >>> correct_bracketing("<>")
    True
    >>> correct_bracketing("<<><>>")
    True
    >>> correct_bracketing("><<>")
    False
    """
    leftbracket = 0
    rightbracket = 0
    for b in brackets:
        if b == "<":
            leftbracket += 1
        else:
            if leftbracket > 0:
                leftbracket -= 1
            else:
                return False
        if b == ">":
            rightbracket += 1
        else:
            if rightbracket > 0:
                rightbracket -= 1
            else:
                return False
        if leftbracket < 0 or rightbracket < 0:
            return False
    if leftbracket != 0 or rightbracket != 0:
        return False
    else:
        return True

